import React from "react";
import Card from "./Card";
import contacts from "../contacts";

function App() {
  return (
    <div>
      <h1 className="heading">My Contacts</h1>
      for i in {contacts}:
      <Card 
        name = {contacts[i].name}
        img = {contacts[i].imgURL}
        tel = {contacts[i].phone}
        emial = {contacts[i].email}
      />
    </div>
  );
}

export default App;
